.text
.globl main
main:

j Startpage # goes to the start page


s_pressed:  # comes back when the key s is pressed 

li $a3, Char_pos # stores the characters position in a global register 

addi  $a3, $a3,SHIFT_NEXT_ROW # LEAVES THE FIRST TWO ROW for the character to be drawn 
addi  $a3, $a3, SHIFT_NEXT_ROW
 
li  $s3,268475528 # the hexadecimal value 0x10009C88 # stores platform 3
li  $s4,268476240 #0x10009F50 # stores platform 4
li $s6,268477224 # stores the memory address for the enemy 
li $s7,268471184 # stors the memory address for the plus sign
	
jal draw_sky # draws the background 
       
                
draw_signs:  # draws the collectibles the positive signs 
 #jal positivesign1
 jal positivesign2
 jal positivesign3
 jal positivesign4
 
 #jal enemy_move    # the enemy moves 

main_loop: # the loop in which everything is drawn and brought to life 
    
         
          jal drawCharacter  # draws the character 
          #jal draw_header    # draws the header 
          jal draw_floor     # draws the floor
          jal draw_platform_1
          jal draw_platform_2
          jal draw_red_sign
          #jal draw_platform_3
          #jal draw_platform_4
        
          
	  
	  
	  
          jal clear_enemy  # moves the enemy 
          jal update_enemy
          jal enemy_move
          
          
          
          li $v0, 32  # sleep 
	  li $a0, 100   # Wait one second (1000 milliseconds) 
	  syscall 
          
          jal clear_plus# moves the  green plus 
          jal update_plus
          jal plus_move
          
          
          
          jal clear_plat4# moves the platform 4
          jal update_plat4
          jal plat4_move
          
          
          
          jal clear_plat3# moves the platform 3
          jal update_plat3
          jal plat3_move

	  li $a1,0xffff0000 # checks for the key press 
	  lw $t9, 0($a1)
	  andi $t9, $t9, 0x0001
	  beq $t9, $zero,check_the_platforms # goes to the function that detects all types of collision    

keypress: # checks for the keypress
	
	li	$t1, SHIFT_NEXT_ROW # loading the values into registers 
	li	$t2, BASE_ADDRESS
	addi	$t2, $t2, SHIFT_NEXT_ROW
	li	$t3, LAST_ADDRESS
	addi	$t3, $t3,-0x1001FFF8
	addi	$t3, $t3, -SHIFT_NEXT_ROW
	
	lw	$t0, 4($a1)
	beq	$t0, 0x61, key_a						# ASCII code of 'a' is 0x61 or 97 in decimal
	beq	$t0, 0x77, key_w						# ASCII code of 'w' is 0x77
	beq	$t0, 0x64, key_d						# ASCII code of 'd' is 0x64
	beq	$t0, 0x70, key_p						# ASCII code of 'p' is 0x70
	j main_loop

	# go left
	key_a:
		# make sure the boy is not in left column
		div	$a3, $t1
		mfhi	$t9						
		beq	$t9, $zero, keypress_done
		jal clear_Character
		jal move_left				

		b keypress_done
	# go up
	key_w:
		# make sure boy is not in top row
		blt	$a3, $t2, keypress_done					
		jal clear_Character
		jal move_up
					
		b keypress_done

	# go right
	key_d:
		# make sure boy is not in the rightmost column
		div	$a3, $t1						
		mfhi	$t9							
		addi	$t1, $t1, -48					
		beq	$t9, $t1, keypress_done					
		jal clear_Character	
		jal move_right			
		b keypress_done

	key_p:
		# restart game
		jal Startpage
		b keypress_done
		
		
	
		
	

       keypress_done:
		j main_loop						
		
	
move_right:                 # character moves right when the key d is pressed  4 is addes to make it move to the left
	add $a3, $a3, 4
	li $a2, NIGHT_SKY
	li $t0, BASE_ADDRESS
	
	
	add $a1, $a3, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	jal drawCharacter
	
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

move_left:                 # character moves left when the key a is pressed -4 is added to make it move to the left 
	add $a3, $a3, -4
	li $a2, NIGHT_SKY
	li $t0, BASE_ADDRESS
	
	
	add $a1, $s0, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)	
	jal drawCharacter
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	
move_up: # character moves up when w is pressed -256 is done to make it move up a row 
	add $a3, $a3, -256
	li $a2, NIGHT_SKY
	li $t0, BASE_ADDRESS
	
	
	add $a1, $a3, $t0
	addi $sp, $sp, -4
	sw $ra, 0($sp)
	add $a3, $a3, -256
	jal drawCharacter
	
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra
	

#----------------------------------------------------------GRAVITY-------------------------------------------------------------------------#

gravity: # Gives gravity to the character  by basically adding 256 ( moving down each row by the addition of 256)
    addi $sp, $sp, -4
    sw $ra, 0($sp)
    
    jal clear_Character  # character gets cleared 
    add $a3, $a3, 256
    
    jal drawCharacter # character gets redrawn the very next row 
    li $v0, 32    # load 32 into register $v0 to trigger the sleep system call
    li $a0, 40 # load the number of milliseconds to sleep into register $a0
    syscall

    lw $ra,0($sp)
    addi $sp,$sp,4
    jr $ra
				
						
#----------------------------------------------------------------------------------------------------------------------------------------------#								

check_the_platforms:
    addi $sp, $sp, -4
    sw $ra,0($sp)
    
    addi $t0,$a3,0xD1c # stores the right shoe pixel
    lw $t6,0($t0) # gets the colour value 
    
    
    addi $t9,$a3,0xB00#stores left shoe
    
    #addi  $t1,$a3,0x728# stores the right cheek pixel
    addi  $t2,$a3,2084# stores the right side pixel
    #addi  $t3,$a3,-4
    
    addi $s1,$a3,0x928
    lw $t8,0($s1)
   #addi  $t3,$a3,0x828# stores the right cheek pixel
    lw $t5, 4($t2)
    beq $t5,RED,gg
    beq $t5,LIGHT_GREEN,stars4
    beq $t5,blue,stars3
    beq $t5,Purple,stars2
    beq $t5,yellow,stars1
     
    #lw $t7,0($t1)# gets the colour value
    lw $t4,0($t2)
    #lw $t8,0($t3)
    lw $s2,0($t9)
   
    lw $t1,0($a3)# gets the colour value for head
    beq $t1,RED,gg
    #beq $t5,DARK_BROWN,gravity
    #beq,$t7,LIGHT_GREEN,stars4
    #beq,$t7,blue,stars3
    #beq,$t7,Purple,stars2
    #beq,$t7,blue,stars1
    #beq,$t7,yellow,stars1
    
  
    beq,$t4,LIGHT_GREEN,stars4
    beq,$t4,blue,stars3
    beq,$t4,Purple,stars2
    beq,$t4,yellow,stars1
    beq,$t6,LIGHT_GREEN,stars4
    beq,$t6,blue,stars3
    beq,$t6,Purple,stars2
    beq,$t6,yellow,stars1
    beq,$t6,yellow,stars1
    beq,$t8,LIGHT_GREEN,stars4
    beq,$t8,blue,stars3
    beq,$t8,Purple,stars2
    beq,$t8,yellow,stars1
    beq $t6,M_DARK,main_loop
    beq $t6,FLOOR,main_loop
    beq $s2,M_DARK,main_loop
    beq $s2,FLOOR,main_loop
    beq $t6,RED,gg
    beq $s2,RED,gg
    beq $t4,RED,gg
    beq $t8,RED,gg
     
   jal gravity
   
    
  nothing:
    lw $ra,0($sp)
    addi $sp,$sp,4
    jr $ra       
    

# to keep track of the collected signs based on colour 
 stars1:         # when yellow sign is touched 
    #li $t1,1
    #beq $t1,1,clearsign4
    li  $s2,0x10008210
    li    $t0,yellow
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2) 
    addi  $s2, $s2, SHIFT_NEXT_ROW
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2)
    exitstar:
    jr $ra
   
 
         
stars2: # when purple sign is touched 
    li  $s2,0x10008220
    li    $t0,Purple
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2) 
    addi  $s2, $s2, SHIFT_NEXT_ROW
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2)
    
   exitstar2:
   jr $ra
   
   

   
 

 stars3: # when blue sign is touched 
    li  $s2,0x10008230
    li    $t0,blue
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2) 
    addi  $s2, $s2, SHIFT_NEXT_ROW
    sw    $t0, 12($s2) 
    sw   $t0, 16($s2)
    exitstars3:
    jr $ra
   
 
 stars4: # when green sign the max point is touched . it goes to the game win screen 
    li  $s2,0x10008000
    li    $t0,LIGHT_GREEN
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2) 
    addi  $s2, $s2, SHIFT_NEXT_ROW
    sw    $t0, 12($s2) 
    sw    $t0, 16($s2)
    exitstars4:
    j Winpage            
       																
       																       																       																
																		
																				
																						
																																																																																																																																									
