plat3_move:  # to make platform 3 move 
	la $t2,plat3_pos	
	
	addi $sp, $sp, -4
	sw   $ra, 0($sp)
	li $t6, 0	
	
	plat3_move_start:	
		beq $t6,1,plat3_move_end
		add $t7, $zero, $t6
		mul $t7,$t7,4
		add $t7,$t7,$t2
		lw   $t8, 0($t7)
		addi $t8, $t8, BASE_ADDRESS
	
		move $s3, $t8
	
		jal draw_platform_3
	
		addi $t6, $t6, 1
	
		j plat3_move_start
	
	
	plat3_move_end: 
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra

clear_plat3: 
	la $t2, plat3_pos	
	
	addi $sp, $sp, -4
	sw   $ra, 0($sp)
	li $t6, 0		
	
	clear_plat3_start:	
		beq $t6, 1, clear_plat3_end
		add $t7, $zero, $t6
		mul $t7,$t7,4
		add $t7,$t7,$t2
		lw   $t8, 0($t7)
		addi $t8, $t8, BASE_ADDRESS
	
		move $s3, $t8
	
		jal clear_platform_3
	
		addi $t6, $t6, 1
	
		j clear_plat3_start
	
	
	clear_plat3_end:
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra


update_plat3: 
	la $t2,plat3_pos
	
	addi $sp, $sp, -4
	sw   $ra, 0($sp)
	li $t6, 0		
	
	update_plat_start:	
		
		beq $t6, 1, update_plat_end
		add $t7, $zero, $t6
		mul $t7,$t7,4				
		add $t7,$t7,$t2				
		lw   $t8, 0($t7)			
		

		
		
		move $s3, $t8
		addi $s3, $s3, BASE_ADDRESS
		move $a0,$s6
		jal get_xy_coordinates
		
		move $t5, $v0
		li $t4, 50
		
		blt  $t5, $t4, plat3_reset 
		
		
		addi $t8, $t8, -4
		sw   $t8, 0($t7)
		j plat3_increment
		
		
		
plat3_reset:		
		addi $s3, $zero, BASE_ADDRESS
		
		addi $s3, $s3, 8648 # found by doing the following calculation ( height(y)*64 + width(x))*4
		
		
	
		
		jal clear_platform_3
		
		addi $t8,$zero, 8528  # found by doing the following calculation ( height(y)*64 + width(x))*4

		sw   $t8, 0($t7)
		j plat3_increment	
		
		
		

		
	
