	sw   $ra, 0($sp)
	li $t6, 0		
	
	update_plus_start:	
		
		beq $t6, 1, update_plus_end
		add $t7, $zero, $t6
		mul $t7,$t7,4				
		add $t7,$t7,$t4				
		lw   $t8, 0($t7)			
		

		
		
		move $s7, $t8
		addi $s7, $s7, BASE_ADDRESS
		move $a0,$s6
		jal get_xy_coordinates
		
		move $t5, $v0
		li $t4, 100
		
		blt  $t5, $t4, plus_reset 
		
		
		addi $t8, $t8, 4
		sw   $t8, 0($t7)
		j plus_increment
		
		
		
plus_reset:		
		addi $s7, $zero, BASE_ADDRESS
		
		addi $s7, $s7, 3016                 # found by doing the following calculation ( height(y)*64 + width(x))*4
		
		
	
		
		jal clearsign1
		
		addi $t8,$zero, 2960              # found by doing the following calculation ( height(y)*64 + width(x))*4

		sw   $t8, 0($t7)
		j plus_increment	
		
		
		

		
	
plus_increment:addi $t6, $t6, 1
	
		j update_plus_start
	
	
update_plus_end:
		lw $ra, 0($sp)
		addi $sp, $sp, 4
		jr $ra 






















