#---------------------------------------------------------------------------------------------------------------------------------------------#
# Start Page 
Startpage: 
    li $t0, BASE_ADDRESS
    la $t1, start_page  # load the address of the start page array into register $t1
    addi $t1, $t1, 4        
    addi $t7, $t0, 16384   

get_page:
   beq $t0, $t7, get_page_exit
   
   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t0, $t0, 4     # increment the display address 
   addi $t1, $t1, 4     # loops through the array 
   
   j get_page 
   
get_page_exit:
     li $s5,0xffff0000 # gets the value of the key when s is pressed 
lw $t8,0($s5)
beq $t8,1,pressed_s
j Startpage

pressed_s:
lw $t5,4($s5)

li $v0, 32 
li $a0, 60  # Wait one second (1000 milliseconds) 
syscall
lw $t5,4($s5)
beq $t5,115,s_pressed
j Startpage

#----------------------------------------------------------------------------------------------------------------------------------------------#
# You win ! page 
Winpage: 
    li $t0, BASE_ADDRESS
    la $t1, win  # load the winpage address of the winpage array into register $t1
    addi $t1, $t1, 4        
    addi $t7, $t0, 16384   

get_win_page:
   beq $t0, $t7, win_exit
   
   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t0, $t0, 4     
   addi $t1, $t1, 4     # loops through the array 
   
   j get_win_page 
   
win_exit:
    li $v0, 10                    # Exit syscall code # to exit the code gracefully 
    syscall
      
#----------------------------------------------------------------------------------------------------------------------------------------------#
# You lost ! page 
 gg: li $t0, BASE_ADDRESS
    la $t1, lose # load the address of the lost page into register $t1
    addi $t1, $t1, 4         
    addi $t7, $t0, 16384   

lost_page:
   beq $t0, $t7, lost_exit
   
   lw $t2, 0($t1)       # load the current color value from the array into register $t2
   sw $t2, 0($t0)       # store the color value in the display memory at the current address in register $t0
   
   addi $t0, $t0, 4    
   addi $t1, $t1, 4     
   
   j lost_page 
   
lost_exit:
li $v0, 10                    # Exit syscall code
syscall
       
    
