#------------------ DRAWS NIGHT SKY------------------------------------------------------------------------------------------------------------#
	
draw_sky:		li $t0, BASE_ADDRESS		# $t0 stores base address
			li $t1, NIGHT_SKY		# $t1 stores blue color code
			addi $t2,$t0,16384		# $t2 stores the last pixel's address
			
loop_draw_sky:	beq $t0, $t2, exit_draw_sky
			sw $t1, 0($t0)			# paint unit night sky
			addi $t0, $t0,4		# increment counter
			j loop_draw_sky
			
exit_draw_sky:	jr $ra				# jump to caller
      
      
      
      
